import React, {Fragment} from 'react';
import { Icon } from '@iconify/react';

const Home = () => ( 
    <Fragment>
        <div id="home">
            <section>
                <div>
                    <span><Icon icon="mdi:gamepad-circle-left mdi-48px" /></span>
                </div>
            </section>
        </div>
    </Fragment>

);

export default Home;
